import React, {useState} from 'react'
import styles from './Example.module.css'

const form = props => {

    const [formState] = useState ({
        form_info: [
            {first: ' '},
            {last: ' '},
            {address: ' '},
            {state: ' '},
            {county: ' '},
            {zipcode: ' '}

        ],
    })

    return (
        <div className={style}>
            <h1>Full Name={formState.form_info[0].first}</h1>
            <h1>Full Name={formState.form_info[0].last}</h1>
            <h1>Full Name={formState.form_info[0].address}</h1>
            <h1>Full Name={formState.form_info[0].state}</h1>
            <h1>Full Name={formState.form_info[0].county}</h1>
            <h1>Full Name={formState.form_info[0].zipcode}</h1>

        </div>
    )
}
export default form;
